import React, {useState} from 'react';

const App = () =>{
const [input, setinput] = useState(6);
const [progress, setprogress] = useState(25);

const change = () =>{
    if(input == 6){
        setprogress(25);
    }
    else if(input == 16){
        setprogress(50);
    }
    else if(input == 24){
        setprogress(75);
    }
    else if(input == 32){
        setprogress(99);
    }
}
    return(
        <>
        <progress value={progress} onChange={(e) =>{
            setprogress(e.target.value);
        }} style={{height:'50px', width:'300px'}} max="100"> 10%</progress>
        <br/>
        <input type="text" value={input} onChange={(e) =>{
            setinput(e.target.value);
        }}/>
        <button onClick={change}
        >Change</button>
          </>
    )
}
export default App;
